import {  useEffect } from 'react';
import MenuItem from '@mui/material/MenuItem';
import TextField from '@mui/material/TextField';
import axios from 'axios';




function SymbolsFetch ({symbols,setSymbols,fromCurrency,setFromCurrency, Item}) {
   useEffect(() => {
    const fetchSymbols = async () => {
      try {
        const res = await axios.get("https://data.fixer.io/api/symbols", {
          params: {
            access_key: "dc8091b34903d6483857ed61900c5f3a",
          },
        });
        setSymbols(res.data.symbols);
      } catch (error) {
        console.error("Failed to load currency symbols:", error.message);
      }
    };
    fetchSymbols();
  }, [setSymbols]
);
  return (
       <Item fromCurrentCurrent={fromCurrency} symbolData={symbols} sx={{ p: 2 }}>
              {Object.keys(symbols).length > 0 && (
                <TextField
                  onChange={(e) => setFromCurrency(e.target.value)}
                  id="outlined-select-currency"
                  select
                  label="Select"
                  value={fromCurrency}
                  helperText="Please select your currency"
                  sx={{
                    label: { color: "rgba(255, 255, 255, 0.7)" },
                    ".MuiOutlinedInput-root": {
                      color: "white", // sets text color
                      backgroundColor: "#1e1e1e", // optional: input background
                      "& fieldset": {
                        borderColor: "rgba(255, 255, 255, 0.5)",
                      },
                      "&:hover fieldset": {
                        borderColor: "white",
                      },
                      "&.Mui-focused fieldset": {
                        borderColor: "#90caf9",
                      },
                    },
                    ".MuiSelect-select": {
                      color: "white", // selected text color
                      backgroundColor: "#1e1e1e", // optional: selected input background
                    },
                    ".MuiSelect-icon": {
                      color: "white",
                    },
                    "& .MuiFormHelperText-root": {
                      color: "rgba(255,255,255,0.6)",
                    },
                  }}
                >
                  {Object.entries(symbols).map(([key, item]) => (
                    <MenuItem key={key} value={key}>
                      {key} - {item}
                    </MenuItem>
                  ))}
                </TextField>
              )}
            </Item>

  )
}

export default SymbolsFetch
